import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">    

      <img src={logo} className="App-logo"  alt="logo" >
        <div>
        <h1>Stunning Ui/Ux design</h1>
       <h3>Lorem ipsum dolor sit amet,
          consectetur adipiscing elit,
           sed do eiusmod tempor incididunt ut labore et</h3>
        </div>
     </img>    
      </header>
    </div>
  );
}

export default App;
